import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <p>
         Welcome to Dr. MIC's office!
        </p>
        <br></br>
        <p>
          Upload an image below to get a diagnosis from Dr. MIC (pronounced Mike and short for Medical Image Classifier).
        </p>
      </header>
    </div>
  );
}

export default App;
